import React from 'react';
// import firebase
import { firebase, config } from './Scripts/Firebase';
import * as hello from "@react-firebase/auth";
console.log(hello);
const {
  FirebaseAuthProvider,
  IfFirebaseAuthed,
  IfFirebaseUnAuthed
} = hello;
// Import the pages
import Main from './Main';

let Application = () => {
  return (
    <div className="Page">
      <FirebaseAuthProvider firebase={firebase} {...config}>
        <IfFirebaseUnAuthed>
          {({ isSignedIn, user, providerId }) => {
            return (
              <button
          onClick={() => {
            const googleAuthProvider = new firebase.auth.GoogleAuthProvider();
            firebase.auth().signInWithPopup(googleAuthProvider);
          }}
        >
          Sign In with Google
        </button>
            )
          }}
        </IfFirebaseUnAuthed>
        <IfFirebaseAuthed>
          {({ isSignedIn, user, providerId }) => {
            return <Main />
          }}
        </IfFirebaseAuthed>
      </FirebaseAuthProvider>
    </div>
  );
}

export default Application;
